      'กฎหมายคุ้มครองข้อมูลที่บังคับใช้ให้สิทธิ์ที่ครอบคลุมแก่คุณในฐานะเจ้าของข้อมูล (สิทธิ์ของข้อมูลและการแทรกแซง) เทียบกับผู้ควบคุมที่เกี่ยวข้องกับการประมวลผลข้อมูลส่วนบุคคลของคุณ ซึ่งเราจะแจ้งให้คุณทราบด้านล่าง:\n\n- สิทธิ์ในข้อมูลตามมาตรา 15 GDPR: โดยเฉพาะอย่างยิ่ง คุณมีสิทธิ์ได้รับข้อมูลเกี่ยวกับข้อมูลส่วนบุคคลของคุณที่เราประมวลผล วัตถุประสงค์ของการประมวลผล ประเภทของข้อมูลส่วนบุคคลที่ประมวลผล ผู้รับหรือประเภทของผู้รับที่ข้อมูลของคุณได้รับหรือจะถูกเปิดเผย ระยะเวลาการจัดเก็บที่วางแผนไว้หรือเกณฑ์ในการกำหนดระยะเวลาในการจัดเก็บ การมีอยู่ของสิทธิ์ในการแก้ไข การลบ การจำกัดการประมวลผล การคัดค้านการประมวลผล การร้องเรียนต่อหน่วยงานกำกับดูแล ที่มาของข้อมูลของคุณหากเราไม่ได้รวบรวมจากคุณ การมีอยู่ของ การตัดสินใจโดยอัตโนมัติ รวมถึงการจัดทำโปรไฟล์ และข้อมูลที่มีความหมายเกี่ยวกับตรรกะที่เกี่ยวข้อง และความสำคัญและผลที่ตามมาของการประมวลผลดังกล่าวสำหรับคุณ รวมถึงสิทธิ์ของคุณที่จะได้รับการแจ้งถึงการรับประกันที่มีอยู่ตามมาตรา 46 GDPR เมื่อข้อมูลของคุณถูกถ่ายโอนไปยังประเทศที่สาม\n\n- สิทธิในการแก้ไขตามมาตรา. 16 GDPR: คุณมีสิทธิ์ที่จะให้มีข้อมูลที่ไม่ถูกต้องเกี่ยวกับคุณได้รับการแก้ไขโดยไม่ชักช้า และ/หรือให้เราจัดเก็บข้อมูลที่ไม่สมบูรณ์ให้ครบถ้วน\n\n- สิทธิในการลบล้างตามมาตรา. 17 GDPR: คุณมีสิทธิ์ร้องขอให้ลบข้อมูลส่วนบุคคลของคุณหากเป็นไปตามเงื่อนไขของ Art. เป็นไปตาม GDPR 17(1) อย่างไรก็ตาม สิทธิ์นี้ใช้ไม่ได้โดยเฉพาะหากการประมวลผลมีความจำเป็นสำหรับการใช้สิทธิเสรีภาพในการแสดงออกและข้อมูล เพื่อปฏิบัติตามภาระผูกพันทางกฎหมาย เพื่อประโยชน์สาธารณะ หรือเพื่อการสร้าง การใช้ หรือการป้องกันข้อเรียกร้องทางกฎหมาย\n\n- สิทธิ์ในการจำกัดการประมวลผลตามมาตรา 18 GDPR: คุณมีสิทธิ์ร้องขอการจำกัดการประมวลผลข้อมูลส่วนบุคคลของคุณตราบเท่าที่ความถูกต้องของข้อมูลของคุณยังได้รับการตรวจสอบ หากคุณได้คัดค้านการลบข้อมูลของคุณเนื่องจากการประมวลผลข้อมูลที่ยอมรับไม่ได้ และขอการจำกัดการประมวลผลข้อมูลของคุณแทน หากคุณต้องการข้อมูลของคุณสำหรับการยืนยัน การดำเนินการ หรือการป้องกันข้อเรียกร้องทางกฎหมาย หลังจากที่เราไม่ต้องการข้อมูลนี้เพื่อบรรลุวัตถุประสงค์ที่ถูกรวบรวมอีกต่อไป หรือหากคุณได้ยื่นคัดค้านโดยเหตุที่เกี่ยวข้องกับ สถานการณ์เฉพาะของคุณ ตราบใดที่ยังไม่ชัดเจนว่าเหตุผลอันชอบด้วยกฎหมายของเรามีผลเหนือกว่าหรือไม่\n\n- สิทธิที่จะได้รับแจ้งตามมาตรา. 19 GDPR: หากคุณใช้สิทธิ์ในการแก้ไข ลบ หรือการจำกัดการประมวลผลกับผู้ควบคุม ผู้ควบคุมมีหน้าที่ต้องแจ้งให้ผู้รับทุกคนที่ได้รับการเปิดเผยข้อมูลส่วนบุคคลของคุณทราบถึงการแก้ไขหรือการลบข้อมูลนี้ หรือการจำกัดการประมวลผล เว้นแต่จะพิสูจน์ได้ว่าเป็นไปไม่ได้หรือเกี่ยวข้องกับความพยายามที่ไม่สมส่วน คุณมีสิทธิ์ที่จะได้รับแจ้งเกี่ยวกับผู้รับเหล่านี้\n\n- สิทธิ์ในการพกพาข้อมูลตามมาตรา 20 GDPR: คุณมีสิทธิ์รับข้อมูลส่วนบุคคลของคุณที่คุณมอบให้เราในรูปแบบที่มีโครงสร้าง ใช้กันทั่วไป และอ่านได้ด้วยเครื่อง หรือขอถ่ายโอนข้อมูลไปยังผู้ควบคุมรายอื่น ในกรณีที่เป็นไปได้ทางเทคนิค\n\n- สิทธิในการเพิกถอนความยินยอมที่ได้รับตามมาตรา 7(3) GDPR: คุณมีสิทธิที่จะเพิกถอนความยินยอมในการประมวลผลข้อมูลได้ตลอดเวลาโดยมีผลในอนาคต ในกรณีที่มีการถอนออก เราจะลบข้อมูลที่เกี่ยวข้องโดยไม่ชักช้า เว้นแต่การประมวลผลเพิ่มเติมจะเป็นไปตามพื้นฐานทางกฎหมายสำหรับการประมวลผลโดยไม่ได้รับความยินยอม การเพิกถอนความยินยอมไม่ส่งผลกระทบต่อความถูกต้องตามกฎหมายของการประมวลผลโดยได้รับความยินยอมก่อนการเพิกถอน\n\n- สิทธิในการยื่นเรื่องร้องเรียนตามมาตรา. 77 GDPR: หากคุณเชื่อว่าการประมวลผลข้อมูลส่วนบุคคลของคุณละเมิด GDPR คุณมีสิทธิ์ยื่นเรื่องร้องเรียนต่อหน่วยงานกำกับดูแล โดยเฉพาะอย่างยิ่งในประเทศสมาชิกของถิ่นที่อยู่ของคุณ สถานที่ทำงานของคุณ หรือสถานที่ที่ถูกกล่าวหาว่าละเมิด โดยไม่กระทบต่อการแก้ไขทางการบริหารหรือการพิจารณาคดีอื่นใด';

